script: |
  super -f text -I q1742.spq | sort > q1742.out

inputs:
  - name: q1742.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 BETWEEN + - 22 AND - col1 * ( + col1 ) * col2 * + - 11 / 14 / + ( - 7 ) + + col1 * - 25 * + col2;
  - name: tab1

outputs:
  - name: q1742.out
    data: |
      51	14	96
      85	5	59
      91	47	68
